import {FaPinterest} from "@react-icons/all-files/fa/FaPinterest";
import {
  FiInstagram,
  FiGithub,
  FiLayout,
  FiSettings,
  FiPenTool,
  FiTag,
  FiMail,
  FiMapPin,
  FiPhone,
} from 'react-icons/fi';

// projects images
import Project1 from './assets/img/marketing.png';
import Project2 from './assets/img/ebook-ing.png';
import Project3 from './assets/img/drive-study.png';
import Project4 from './assets/img/curso-ing.png';
import Project5 from './assets/img/apostilas.png';
import Project6 from './assets/img/filadd.png';

// skills images
import SkillImg1 from './assets/img/skills/html5.png';
import SkillImg2 from './assets/img/skills/css3.png';
import SkillImg3 from './assets/img/skills/js.png';
import SkillImg4 from './assets/img/skills/reactjs.png';
import SkillImg7 from './assets/img/skills/git.png';
// navigation
export const navigation = [
  {
    name: 'home',
    href: 'home',
  },
  {
    name: 'about',
    href: 'about',
  },
  {
    name: 'materiais',
    href: 'materiais',
  },
  {
    name: 'services',
    href: 'services',
  },
  {
    name: 'contact',
    href: 'contact',
  },
];

// social
export const social = [
  {
    icon: <FiInstagram />,
    href: 'https://www.instagram.com/carolm_studies/?hl=es',
  },
  {
    icon: <FiGithub />,
    href: 'https://github.com/carolinemariotto',
  },
  {
    icon: <FaPinterest/>,
    href: 'https://br.pinterest.com/carolmstudies/',
  },
];

export const projectsData = [
  {
    id: '1',
    image: Project1,
    name: 'E-book Marketing Digital',
    category: 'GRATUITOS',
  },
  {
    id: '2',
    image: Project2,
    name: 'E-book de Inglês',
    category: 'GRATUITOS',
  },
  {
    id: '3',
    image: Project3,
    name: 'CONTEÚDO DE ESTUDOS',
    category: 'GRATUITOS',
  },
  {
    id: '4',
    image: Project4,
    name: 'Curso de Inglês',
    category: 'SITES',
    href: ''
  },
  {
    id: '5',
    image: Project5,
    name: 'project name 5',
    category: 'INDICAÇÃO',
  },
  {
    id: '6',
    image: Project6,
    name: 'project name 6',
    category: 'INDICAÇÃO',
  
  },
];

// projects
export const projectsNav = [
  {
    name: 'Tudo',
  },
  {
    name: 'Gratuitos',
  },
  {
    name: 'Sites',
  },
  {
    name: 'Indicação',
  },
];

// skill
export const skills = [
  {
    image: SkillImg1,
  },
  {
    image: SkillImg2,
  },
  {
    image: SkillImg3,
  },
  {
    image: SkillImg4,
  },
  {
    image: SkillImg7,
  },
 
];

// services
export const services = [
  {
    icon: <FiLayout />,
    name: 'Web Design',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Odio perferendis volm quibusdam ullam qui dolore.',
  },
  {
    icon: <FiSettings />,
    name: 'Web Development',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Odio perferendis volm quibusdam ullam qui dolore.',
  },
  {
    icon: <FiPenTool />,
    name: 'Branding',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Odio perferendis volm quibusdam ullam qui dolore.',
  },
  {
    icon: <FiTag />,
    name: 'SEO',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Odio perferendis volm quibusdam ullam qui dolore.',
  },
];

// contact
export const contact = [
  {
    icon: <FiMail />,
    title: 'Alguma dúvida?',
    subtitle: 'Me mande no e-mail:',
    description: 'Email: carol.mariiotto@gmail.com',
  },
  {
    icon: <FiPhone/>,
    title: 'Insta: @carolm_studie',
    subtitle: 'Tiktok: carol_mariotto',
  },
  {
    icon: <FaPinterest/>,
    href: 'https://br.pinterest.com/carolmstudies/',
    title: 'Pinterest: carolmstudies',

  }
];
